import { include } from 'named-urls';
import {
  faObjectGroup,
  faBuilding,
  faObjectUngroup
} from '@fortawesome/free-regular-svg-icons';
import {
  faUsers,
  faShapes,
  faChartLine,
  faQrcode
} from '@fortawesome/free-solid-svg-icons';

const userSessionCookie = 'upayogakarta';


const TODOS_ROUTE = {
  LOGIN: '/login/',
  SIGN_UP: '/signup/',
  TODOS: include('/todos/', {
    LIST: '',
    ADD: 'add/',
    DETAIL: include(':todoId/', {
      SHOW: '',
      MODIFY: 'modify/'
    })
  }),
};

export {
  userSessionCookie,
  TODOS_ROUTE
};
